import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import registration from '.components/registration'; // Pastikan path sudah benar
import loginadmin from '.components/loginadmin'; // Pastikan path sudah benar

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/loginadmin" component={loginadmin} />
                <Route path="/" component={registration} />
            </Switch>
        </Router>
    );
};

export default App;
